import React from "react";
import Navbar from "../Components/Navbar";

export default function AboutPage() {
  return (
    <>
      <div className="bg-black fixed  block h-36 w-full md:h-20">
        <Navbar />
      </div>
      {/* index header section  */}
      <section className=" min-h-80 md:min-h-[28rem] IndexHeaderBackground flex">
        <div className="md:mx-52 m-auto flex flex-col gap-7">          
            <h3 className="text-gray-300 md:text-7xl pt-20 md:pt-14 text-6xl font-bold  font-mono francois-one-regular">
              About Me
            </h3>
            <p className="text-gray-400 text-lg ">Home / About Me</p>
        </div>
      </section>
    </>
  );
}
